import React, {Fragment} from 'react';
import { GlobalStyle } from './styles/global';

function App() {
  return (
    <>
    <GlobalStyle>
    <Fragment>
    <h1> Hello World! </h1>
    </Fragment>
    </GlobalStyle>
    </>
  );
}

export default App;
